angular.module('starter.controllers', [])

  .controller('homeCtrl', function($scope,$ionicModal, $ionicSlideBoxDelegate) {

    $scope.imageBase64 = "";
    $scope.imageBase64JPEG = "";

    $scope.imageBase64GIF = "";

    $scope.imagearray = [$scope.imageBase64,$scope.imageBase64JPEG,$scope.imageBase64GIF];
    $scope.imagenames = ['base64','base64JPEG','base64GIF'];
    $scope.typesarray = ['png','jpg','gif'];


    $scope.name = "keensoft";
    $scope.imageUrlPath ="img/keensoft.png";
    $scope.imageUrlPathJPEG ="img/keensoft.jpg";
    $scope.imagearrayPath = [$scope.imageUrlPath,$scope.imageUrlPathJPEG,$scope.imageUrlPath];

    $scope.openImageB64 = function(url, name, type){
      window.FullScreenImage.showImageBase64(url,name,type);
    }

    $scope.openImageUrl = function(url){
      window.FullScreenImage.showImageURL(url);
    }


    /*Modal Viewer configurtion*/

    $scope.aImages = [{
      'src' : $scope.imagearrayPath[0],
      'msg' : 'Titulo de la imagen 1'
    }, {
      'src' : $scope.imagearrayPath[1],
      'msg' : 'Titulo de la imagen 2'
    }, {
      'src' : $scope.imagearrayPath[2],
      'msg' : 'Titulo de la imagen 3'
    }];

    $scope.aImagesB64 = [{
      'src' : $scope.imagearray[0],
      'type': $scope.imagearray[0],
      'msg' : $scope.imagenames[0]
    }, {
      'src' : $scope.imagearray[1],
      'type': $scope.imagearray[1],
      'msg' : $scope.imagenames[1]
    }, {
      'src' : $scope.imagearray[2],
      'type': $scope.imagearray[2],
      'msg' : $scope.imagenames[2]
    }];

    $ionicModal.fromTemplateUrl('image-modal.html', {
      scope: $scope,
      animation: 'slide-in-up'
    }).then(function(modal) {
      $scope.modal = modal;
    });

    $ionicModal.fromTemplateUrl('image-modal-base64.html', {
      scope: $scope,
      animation: 'slide-in-up'
    }).then(function(modal) {
      $scope.modalB64 = modal;
    });

    $scope.openModal = function() {
      $ionicSlideBoxDelegate.slide(0);
      $scope.modal.show();
    };
    $scope.openModalB64 = function() {
      $ionicSlideBoxDelegate.slide(0);
      $scope.modalB64.show();
    };

    $scope.closeModalB64 = function() {
      $scope.modalB64.hide();
    };

    $scope.closeModal = function() {
      $scope.modal.hide();
    };

    // Cleanup the modal when we're done with it!
    $scope.$on('$destroy', function() {
      $scope.modal.remove();
      $scope.modalB64.remove();
    });
    // Execute action on hide modal
    $scope.$on('modal.hide', function() {
      // Execute action
    });
    // Execute action on remove modal
    $scope.$on('modal.removed', function() {
      // Execute action
    });
    $scope.$on('modal.shown', function() {
      console.log('Modal is shown!');
    });

    // Call this functions if you need to manually control the slides
    $scope.next = function() {
      $ionicSlideBoxDelegate.next();
    };

    $scope.previous = function() {
      $ionicSlideBoxDelegate.previous();
    };

    $scope.goToSlide = function(index) {
      $scope.modal.show();
      $ionicSlideBoxDelegate.slide(index);
    }

    // Called each time the slide changes
    $scope.slideChanged = function(index) {
      $scope.slideIndex = index;
    };


  })